"use client"

import { useEffect, useState } from "react"
import axios from "axios"
import Layout from "../components/layout"
import { BookOpen, User } from "lucide-react"

const StudentCourseView = () => {
  const [courses, setCourses] = useState([])
  const [loading, setLoading] = useState(true)
  const [error, setError] = useState("")

  useEffect(() => {
    const fetchEnrolledCourses = async () => {
      try {
        const authToken = localStorage.getItem("authToken")
        const res = await axios.get("http://localhost:5000/api/courses/student-course-view", {
          headers: { Authorization: `Bearer ${authToken}` },
        })
        setCourses(res.data)
      } catch (err) {
        console.error("Failed to fetch student courses:", err.response ? err.response.data : err.message)
        setError("Failed to load your courses.")
      } finally {
        setLoading(false)
      }
    }

    fetchEnrolledCourses()
  }, [])

  if (loading)
    return (
      <Layout>
        <div className="flex justify-center items-center h-64">
          <div className="animate-pulse text-blue-600">Loading your courses...</div>
        </div>
      </Layout>
    )

  if (error)
    return (
      <Layout>
        <div className="bg-red-50 p-4 rounded-md">
          <div className="flex">
            <div className="ml-3">
              <h3 className="text-sm font-medium text-red-800">{error}</h3>
            </div>
          </div>
        </div>
      </Layout>
    )

  return (
    <Layout>
      <div className="space-y-6">
        <div>
          <h1 className="text-2xl font-semibold text-gray-900">My Enrolled Courses</h1>
          <p className="mt-1 text-sm text-gray-500">View all courses you are currently enrolled in.</p>
        </div>

        {courses.length === 0 ? (
          <div className="bg-white shadow overflow-hidden sm:rounded-md p-6 text-center text-gray-500">
            You are not enrolled in any courses yet.
          </div>
        ) : (
          <div className="bg-white shadow overflow-hidden sm:rounded-md">
            <ul className="divide-y divide-gray-200">
              {courses.map((course) => (
                <li key={course._id}>
                  <div className="px-4 py-4 sm:px-6">
                    <div className="flex items-center">
                      <div className="flex-shrink-0">
                        <BookOpen className="h-6 w-6 text-blue-600" />
                      </div>
                      <div className="ml-4 flex-1">
                        <h3 className="text-lg font-medium text-gray-900">{course.title}</h3>
                        <p className="mt-1 text-sm text-gray-500">{course.description}</p>
                        <div className="mt-2 flex items-center text-sm text-gray-500">
                          <User className="flex-shrink-0 mr-1.5 h-4 w-4 text-gray-400" />
                          <p>
                            Instructor: {course.instructorId?.name} ({course.instructorId?.email})
                          </p>
                        </div>
                      </div>
                      <div className="ml-4 flex-shrink-0">
                        <span className="inline-flex items-center px-2.5 py-0.5 rounded-full text-xs font-medium bg-blue-100 text-blue-800">
                          {course.studentCount || 0} students
                        </span>
                      </div>
                    </div>
                  </div>
                </li>
              ))}
            </ul>
          </div>
        )}
      </div>
    </Layout>
  )
}

export default StudentCourseView
